import "../../assets/scss/fourthScreen/articles.scss";
import ArticleCarouselElem from "./Carousel";

const Articles = () => {
  return (
      <>
    <div className="articles">
      <h1 className="articles-title">Полезные статьи</h1>
    </div>
    <ArticleCarouselElem />
    </>
  );
};

export default Articles;
